-- Table structure for tb_user_role_map
-- ----------------------------
DROP TABLE IF EXISTS `tb_user_role_map`;
CREATE TABLE `tb_user_role_map`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
